" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 634px\">",
"   <div class=\"ttl\">",
"    Abnormal growth in a child with Cushing's disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 614px; height: 794px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Growth chart of a girl diagnosed with Cushing's disease at age 11.25 years. The patient had poor height velocity since age 9.6 years in conjunction with a 2.25-year delayed bone age (leftward arrow from height point at actual age 11.25 years), and excessive weight gain over the same time period. An ACTH-producing pituitary adenoma was discovered and removed by trans-sphenoidal surgery at age 11.5 years. The patient subsequently had full biochemical recovery, initially followed by a significant improvement in height velocity and a significant reduction in weight (loss of 16 pounds over 6 months). With progressive puberty, the patient's bone age delay decreased (1.25 years at actual age 12.25 years, and 0.5 years at actual age 14 years) in association with physiological height plateauing. The progressive acceleration in bone age was likely due to the effects of pubertal estrogen. The bracket at the far right of the height curve represents the mid-parental target height range (&plusmn;1 SD). As is typical in patients with childhood Cushing's disease, the mid-parental target height was not achieved.",
"    <sup>",
"     [1]",
"    </sup>",
"    <div class=\"footnotes\">",
"     ACTH: adrenocorticotropic hormone; GnRH: gonadotropin hormone releasing hormone; SD: standard deviation; %: percent.",
"    </div>",
"    <div class=\"reference\">",
"     Reference:",
"     <br/>",
"     <ol>",
"      <li>",
"       Chan LF, Storr HL, Grossman AB, Savage MO. Pediatric Cushing's syndrome: Clinical features, diagnosis, and treatment. Arq Bras Endocrinol Metabol 2007; 51:1261-1271.",
"      </li>",
"     </ol>",
