var title_f42_17_43292="Features of systemic sclerosis";
var content_f42_17_43292=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F67889&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F67889&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features of the major systemic Sclerosis subsets",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diffuse cutaneous",
"       </td>",
"       <td class=\"subtitle1\">",
"        Early (&lt;3 years after onset)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Late (&gt;3 years after onset)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Constitutional",
"       </td>",
"       <td>",
"        Fatigue and weight loss",
"       </td>",
"       <td>",
"        Minimal, weight gain typical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vascular",
"       </td>",
"       <td>",
"        Raynaud's often relatively mild",
"       </td>",
"       <td>",
"        Raynaud's more severe, more telangiectasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cutaneous",
"       </td>",
"       <td>",
"        Rapid progression involving arms, trunk, face",
"       </td>",
"       <td>",
"        Stable or regression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Musculoskeletal",
"       </td>",
"       <td>",
"        Prominent arthralgia, stiffness, myalgia, muscle weakness, tendon friction rubs",
"       </td>",
"       <td>",
"        Flexion contractures and deformities, joint/muscle symptoms less prominent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gastrointestinal",
"       </td>",
"       <td>",
"        Dysphagia, heartburn",
"       </td>",
"       <td>",
"        More pronounced symptoms, midgut and anorectal complications more common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiopulmonary",
"       </td>",
"       <td>",
"        Maximum risk for myocarditis, pericardial effusion, intersitital pulmonary fibrosis",
"       </td>",
"       <td>",
"        Reduced risk of new involvement but progression of existing established visceral fibrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal",
"       </td>",
"       <td>",
"        Maximum risk period for scleroderma after 5 years",
"       </td>",
"       <td>",
"        Renal crisis less frequent, uncommon after 5 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Limited cutaneous",
"       </td>",
"       <td class=\"subtitle1\">",
"        Early (&lt;10 years after onset)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Late (&gt;10 years after onset)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Constitutional",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        Only secondary to visceral complications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vascular",
"       </td>",
"       <td>",
"        Raynaud's typically severe and longstanding telangiectasia",
"       </td>",
"       <td>",
"        Raynaud's persists, often causing digital ulceration or gangrene",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cutaneous",
"       </td>",
"       <td>",
"        Mild sclerosis with little progression on trunk, face",
"       </td>",
"       <td>",
"        Stable, calcinosis more prominent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Musculoskeletal",
"       </td>",
"       <td>",
"        Occasional joint stiffness",
"       </td>",
"       <td>",
"        Mild flexion contractures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gastrointestinal",
"       </td>",
"       <td>",
"        Dysphagia, heartburn",
"       </td>",
"       <td>",
"        More pronounced symptoms, midgut and anorectal complications more common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiopulmonary",
"       </td>",
"       <td>",
"        Usually no involvement",
"       </td>",
"       <td>",
"        Lung fibrosis may develop, but often progresses slowly, Anti-SCL-70 predicts increased risk of severe fibrosis. Maximum risk for developing isolated pulmonary hypertension and secondary right ventricular failure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal",
"       </td>",
"       <td>",
"        No involvement",
"       </td>",
"       <td>",
"        Rarely involved, anti-RNA polymerase predicts increased risk of renal involvement.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
