var title_f42_17_43293="Pravastatin and inflammation";
var content_f42_17_43293=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69156&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69156&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 496px\">",
"   <div class=\"ttl\">",
"    Predictive value of inflammation post-MI attenuated by pravastatin",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 476px; height: 282px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the CARE trial, patients experiencing a recurrent coronary event within two years of a myocardial infarction (MI) had higher serum concentrations of C-reactive protein and amyloid A compared to those without an event. Pravastatin attenuated this effect; the risk of a coronary event in patients with evidence of inflammation taking pravastatin (third column) was lower than in those with inflammation taking placebo (fourth column) and was identical to those without evidence of inflammation (first two columns).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Ridker PM, Rifai N, Pfeffer MA, et al, for the Cholesterol and Recurrent Events (CARE) Investigators, Circulation 1998; 98:839.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f42_17_43293=[""].join("\n");
var outline_f42_17_43293=null;
var title_f42_17_43294="ACLS algorithm cardioversion";
var content_f42_17_43294=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F74033&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F74033&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Synchronized cardioversion algorithm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 383px; height: 436px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Notes:",
"     <br>",
"      1. Effective regimens have included a sedative (eg, diazeparn, midazolam, barbiturates, etomidate, ketamine, methchexital) with or without an analgesic agent (eg, fentanyl, morphine, meperidine). Many experts recommend anesthesia if service is readily available.",
"      <br>",
"       2. Both monophasic and biphasic waveforms are acceptable if documented as clinically equivalent to reports of monophasic shock success.",
"       <br>",
"        3. Note possible need to resynchronize after each cardioversion.",
"        <br>",
"         4. If delays in synchronization occur and clinical condition is critical, go immediately to unsynchronized shocks.",
"         <br>",
"          5. Treat polymorphic ventricular tachycardia (irregular form and rate) like ventricular fibrillation.",
"          <br>",
"           6. Paroxysmal supraventricular tachycardia and atrial flutter often respond to lower energy levels (start with 50 J).",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Guidelines 2000 for Cardiopulmonary Resuscitation and Emergency Cardiovascular Care. Circulation 2000; 102:I-164.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
